INSERT INTO `Movies` VALUES (37,250572,'Break Point','Jimmy Price is a reckless man-child on the last leg of his career as a doubles tennis player. When his latest partner drops him, he realizes he\'s officially burned all of his bridges on the pro circuit. He decides to make one last ditch effort to revive his career, reaching outside of the tennis world and convincing his childhood partner -- his estranged brother Darren, now an apathetic substitute teacher - to team up with him. The mismatched pair, with the help of a unique 11-year-old named Barry, make an unlikely run at a grand slam tournament and are forced to re-discover their game, and their brotherhood.',7,90,'Comedy',2014,6,'https://image.tmdb.org/t/p/w500/vJFAg3vc2s9aHV14CWirg3JNFOQ.jpg'),(38,257088,'Point Break','A young undercover FBI agent infiltrates a gang of thieves who share a common interest in extreme sports. A remake of the 1991 film, \"Point Break\".',11,114,'Action',2015,5.7,'https://image.tmdb.org/t/p/w500/z7JOvw5Lqs9ezoFTJxmz3nx3av2.jpg'),(39,700895,'Batman Begins - Boxset \"Additional Footage\"','Batman Begins - Boxset Extras',NULL,5,NULL,0,0,NULL),(40,501496,'Chill','A girl visits her ex-boyfriend in search of their lost intimacy.',15,10,'Drama',2012,0,'https://image.tmdb.org/t/p/w500/ms2CVZw7Yz3DLztukYJUUr4JMGq.jpg'),(41,1572,'Die Hard: With a Vengeance','New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought he\'d seen it all, until a genius named Simon engages McClane, his new \"partner\" -- and his beloved city -- in a deadly game that demands their concentration.',18,128,'Action',1995,7.2,'https://image.tmdb.org/t/p/w500/7mBUd8Y6AhcdICaMnSV8UPtF8rc.jpg'),(42,754,'Face/Off','An antiterrorism agent goes under the knife to acquire the likeness of a terrorist and gather details about a bombing plot. When the terrorist escapes custody, he undergoes surgery to look like the agent so he can get close to the agent\'s family.',22,138,'Action',1997,6.9,'https://image.tmdb.org/t/p/w500/aYZDYdiMym5xEkSs4BrJMXFdZ9g.jpg'),(43,7516,'Smokin\' Aces','When a Las Vegas performer-turned-snitch named Buddy Israel decides to turn state\'s evidence and testify against the mob, it seems that a whole lot of people would like to make sure he\'s no longer breathing.',26,109,'Action',2006,6.5,'https://image.tmdb.org/t/p/w500/nrdnN8WqvyOt8Bnl3hgWcZD6ZyM.jpg'),(44,11565,'Big Momma\'s House 2','FBI agent Malcolm Turner goes back undercover as Big Momma, a slick-talking, slam-dunking Southern granny with attitude to spare! Now this granny must play nanny to three dysfunctional upper class kids in order to spy on their computer hacked dad.',30,99,'Comedy',2006,5.7,'https://image.tmdb.org/t/p/w500/tOl6hzfFHdNcL7SxopC2Vbs4mgK.jpg'),(45,96,'Beverly Hills Cop II','Axel heads for the land of sunshine and palm trees to find out who shot police Captain Andrew Bogomil. Thanks to a couple of old friends, Axel\'s investigation uncovers a series of robberies masterminded by a heartless weapons kingpin—and the chase is on.',34,103,'Action',1987,6.4,'https://image.tmdb.org/t/p/w500/2QiIvtVltUJPKyx5qP2hAtVcjey.jpg'),(46,8961,'Bad Boys II','Out-of-control, trash-talking buddy cops Marcus Burnett and Mike Lowrey of the Miami Narcotics Task Force reunite, and bullets fly, cars crash and laughs explode as they pursue a whacked-out drug lord from the streets of Miami to the barrios of Cuba. But the real fireworks result when Marcus discovers that playboy Mike is secretly romancing Marcus’ sexy sister.',38,147,'Adventure',2003,6.5,'https://image.tmdb.org/t/p/w500/yCvB5fG5aEPqa1St7ihY6KEAsHD.jpg'),(47,303,'Notorious','In order to help bring Nazis to justice, U.S. government agent T.R. Devlin recruits Alicia Huberman, the American daughter of a convicted German war criminal, as a spy. As they begin to fall for one another, Alicia is instructed to win the affections of Alexander Sebastian, a Nazi hiding out in Brazil. When Sebastian becomes serious about his relationship with Alicia, the stakes get higher, and Devlin must watch her slip further undercover.',41,103,'Thriller',1946,7.9,'https://image.tmdb.org/t/p/w500/yUjKnpColooH88BFQJwwgNOQ56N.jpg'),(48,562,'Die Hard','NYPD cop John McClane\'s plan to reconcile with his estranged wife is thrown for a serious loop when, minutes after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.',18,131,'Action',1988,7.7,'https://image.tmdb.org/t/p/w500/aJCpHDC6RoGz7d1Fzayl019xnxX.jpg');
/*!40000 ALTER TABLE `Movies` ENABLE KEYS */;
UNLOCK TABLES;

