INSERT INTO `TvShows` VALUES (1,72325,'The Black Arrow','Based on the novel by Robert Louis Stevenson, The Black Arrow tells the tale of Richard Shelton, a knight who avenges the death of his father during the War of the Roses. Richard is surrounded by enemies, some of whom he considers his most trusted companions.',NULL,0,NULL,1972,0,'https://image.tmdb.org/t/p/w500/j4d1hvKRaanAlptpW7VQt2Z4Af.jpg'),(21,97421,'Dirty Pair Flash','Kei and Yuri were originally junior auxiliary agents in the Worlds Works and Welfare Agency (W.W.W.A. or 3WA for short) when the two were paired together under the codename \"Lovely Angels.\" Kei was coming off her fourth probation for something she had done, and Yuri\'s dating exploits were common knowledge, not to mention the two had an instant dislike for each other when they met. At first, Kei and Yuri refused to work with each other, and Kei even resigned from the 3WA. Afterwards, the two continued to work together, although they earned their nickname, \"the Dirty Pair\" because of all the collateral damage the two (unintentionally) cause in the completion of their cases. And even though the two now get along with one another, they continue to bicker and complain to each other.',NULL,0,'Animation',1994,7,'https://image.tmdb.org/t/p/w500/uHnZ4cg4KPTWbQFqltDeuCblKDi.jpg'),(49,2303,'Hawaii Five-O','Hawaii Five-O is an American police procedural drama series produced by CBS Productions and Leonard Freeman. Set in Hawaii, the show originally aired for 12 seasons from 1968 to 1980, and continues in reruns. Jack Lord portrayed Detective Lieutenant Steve McGarrett, the head of a special state police task force which was based on an actual unit that existed under martial law in the 1940s. The theme music composed by Morton Stevens became especially popular. Many episodes would end with McGarrett instructing his subordinate to \"Book \'em, Danno!\", sometimes specifying a charge such as \"murder one\".',47,60,'Action & Adventure',1968,7.3,'https://image.tmdb.org/t/p/w500/atNYXmCRm34VGNB9xHOI3IkKF54.jpg'),(334,46374,'Katanagatari','The historical epic centers on Shichika Yasuri, the seventh generational head of the Kyotō-ryū school of martial arts in medieval Japan. He and his older sister Nanami live on an isolated island, until a military advisor named Togame tells him of the final 12 swords forged by a legendary swordsmith. At Togame\'s bidding, Shichika embarks on a journey to find all 12 of the swords.',51,50,'Action & Adventure',2010,7.4,'https://image.tmdb.org/t/p/w500/jk11mCSE5sNlfuN4DHsSvRYMc8M.jpg'),(346,42671,'Elfen Lied','The Diclonius, a mutated homo sapien that is said to be selected by God and will eventually become the destruction of mankind, possesses two horns in their heads, and has a \"sixth sense\" which gives it telekinetic abilities. Due to this dangerous power, they have been captured and isolated in laboratories by the government. Lucy, a young and psychotic Diclonius, manages to break free of her confines and brutally murder most of the guards in the laboratory, only to get shot in the head as she makes her escape. She survives and manages to drift along to a beach, where two teenagers named Kouta and Yuka discovers her. Having lost her memories, she was named after the only thing that she can now say, \"Nyuu,\" and the two allow her to stay at Kouta\'s home. However, it appears that the evil \"Lucy\" is not dead just yet...',55,25,'Animation',2004,8,'https://image.tmdb.org/t/p/w500/1Qaei4Vst8i0DfzdqhOJJHc5JAY.jpg'),(360,66857,'Shooter','Bob Lee Swagger is an expert marksman living in exile who is coaxed back into action after learning of a plot to kill the president.',59,42,'Action & Adventure',2016,6.8,'https://image.tmdb.org/t/p/w500/oMmqtafm6Rdlka1ejJeC9BDWzyO.jpg'),(391,13916,'Death Note','Light Yagami is an ace student with great prospects—and he’s bored out of his mind. But all that changes when he finds the Death Note, a notebook dropped by a rogue Shinigami death god. Any human whose name is written in the notebook dies, and Light has vowed to use the power of the Death Note to rid the world of evil. But will Light succeed in his noble goal, or will the Death Note turn him into the very thing he fights against?',NULL,22,'Animation',2006,8.4,'https://image.tmdb.org/t/p/w500/b2pmNGKlHolQ07CzQP9VOXYMMjC.jpg'),(428,1338,'Alarm for Cobra 11: The Motorway Police','Alarm für Cobra 11 – Die Autobahnpolizei is a long-running, popular German television series about a two-man team of highway police, originally set in Berlin and later in North Rhine-Westphalia. The series has been broadcast in countries worldwide.\n\nIhr Revier ist die Autobahn (Their precinct is the autobahn)\n\nIhr Tempo ist mörderisch (They work at break-neck speed)\n\nIhre Gegner: Autoschieber, Mörder und Erpresser (They\'re up against car thieves, burglars, and extortionists)\n\nEinsatz rund um die Uhr für die Männer von Cobra 11 (They\'re on call around the clock: the men of Cobra 11)\n\nUnsere Sicherheit ist ihr Job (Our safety is their job).',66,90,'Drama',1996,6.2,'https://image.tmdb.org/t/p/w500/c8lsQktNdA5pXGvSzY35zfhShqI.jpg'),(793,45950,'High School DxD','The story follows Issei Hyōdō, a dim-witted, lecherous second-year high school student who is killed by a girl on his first date ever. Issei is reincarnated as a devil, and from that day forward, he serves as an underling of Riasu, a high-level devil who is also the prettiest girl on Issei\'s campus.',70,24,'Action & Adventure',2012,8.5,'https://image.tmdb.org/t/p/w500/d5Ddv3OR6afzwzTvEcOnwS9RsZ1.jpg'),(860,474,'Nash Bridges','Nash Bridges is an American television police drama created by Carlton Cuse. The show starred Don Johnson and Cheech Marin as two Inspectors with the San Francisco Police Department\'s Special Investigations Unit. The show ran for six seasons on CBS from March 29, 1996 to May 4, 2001 with a total of 122 episodes being produced.\n\nThe show has aired in over 70 countries. It currently airs in the Middle East on MBC\'s newly launched Action block MBC Action, DR2 in Denmark, Crime & Investigation Network, WGN America, Universal HD in the United States, TV1 in Australia, 13th Street in The Netherlands and Universal Channel in Serbia.',74,45,'Drama',1996,6.6,'https://image.tmdb.org/t/p/w500/iCgIAqoR4rB3gNIhZBKTB3zlMUm.jpg'),(982,3716,'Dragnet','Dragnet is a radio, television and motion picture series, enacting the cases of a dedicated Los Angeles police detective, Sergeant Joe Friday, and his partners. The show takes its name from the police term \"dragnet\", meaning a system of coordinated measures for apprehending criminals or suspects.',78,30,'Drama',1951,6.7,'https://image.tmdb.org/t/p/w500/393BVqnVaioYBE5f3LMUwFRAwPQ.jpg'),(1257,2072,'The Bill','The daily lives of the men and women at Sun Hill Police Station as they fight crime on the streets of London. From bomb threats to armed robbery and drug raids to the routine demands of policing this ground-breaking series focuses as much on crime as it does on the personal lives of its characters.',81,25,'Crime',1984,5.9,'https://image.tmdb.org/t/p/w500/bMd4T647b9YdkbQvULyndBNV8uL.jpg'),(3615,10309,'McCloud','McCloud is an American television police drama',85,120,'Drama',1970,7.3,'https://image.tmdb.org/t/p/w500/kPjXgU17GXTKkg0gKJmvmHRW4Bw.jpg'),(3663,100354,'Amongst Men','It is the golden age of gangs, and one of the darkest times for the police, who are controlled by a group of millionaire commissioners sharing in the illicit businesses of Buenos Aires.',NULL,60,'Drama',2020,0,'https://image.tmdb.org/t/p/w500/ua7QFNnspjLcjrc0nCY9RRonmHS.jpg'),(3667,80307,'Bodyguard','A troubled war veteran is assigned to protect a controversial politician who may be the target of a terror plot.',92,60,'Crime',2018,8,'https://image.tmdb.org/t/p/w500/5DUJTrHTRLHLCKWriPhdusQogAv.jpg'),(3673,60585,'Bosch','Based on Michael Connelly\'s best-selling novels, these are the stories of relentless LAPD homicide Detective Harry Bosch who pursues justice at all costs. But behind his tireless momentum is a man who is haunted by his past and struggles to remain loyal to his personal code: “Everybody counts or nobody counts.”',96,45,'Mystery',2014,7.9,'https://image.tmdb.org/t/p/w500/fmBAmAyR6aMo1HAutV0oZ8Y7emb.jpg'),(3733,44264,'Endeavour','The early days of a young Endeavour Morse, whose experiences as a detective constable with the Oxford City Police will ultimately shape his future.',100,120,'Crime',2013,8.2,'https://image.tmdb.org/t/p/w500/z7mbGUY5tcwDiS07TvKsg2zz0v6.jpg'),(3763,2171,'Cold Case','The Philadelphia homicide squad\'s lone female detective finds her calling when she is assigned cases that have never been solved. Detective Lilly Rush combines her natural instincts with the updated technology available today to bring about justice for all the victims she can.',103,60,'Crime',2003,7.5,'https://image.tmdb.org/t/p/w500/8fLFSq7QKH4uus56k2RO4zBS1mk.jpg'),(3920,3381,'Robbery Homicide Division','Robbery Homicide Division was an American police procedural television series on CBS, created by Barry Schindel with executive producer Michael Mann. Schindel has been nominated for three Emmy Awards.',107,60,'Drama',2002,8.5,'https://image.tmdb.org/t/p/w500/kF0B5Tzi9WlsKJphK237ADK489z.jpg'),(3933,67116,'Lethal Weapon','A slightly unhinged former Navy SEAL lands a job as a police officer in Los Angeles where he\'s partnered with a veteran detective trying to keep maintain a low stress level in his life.',111,43,'Action & Adventure',2016,7.2,'https://image.tmdb.org/t/p/w500/jbMZkxLHVDSKiZh0HppCthRW96k.jpg'),(3988,39483,'Major Crimes','Major Crimes explores how the American justice system approaches the art of the deals as law enforcement officers and prosecutors work together to score a conviction. Los Angeles Police Captain Sharon Raydor heads up a special squad within the LAPD that deals with high-profile or particularly sensitive crimes.',115,43,'Drama',2012,6.9,'https://image.tmdb.org/t/p/w500/fZ502JXujnxVtprmigTO2jA205P.jpg'),(4093,1450,'The Closer','Deputy Police Chief Brenda Jean Johnson transfers from Atlanta to LA to head up a special unit of the LAPD that handles sensitive, high-profile murder cases. Johnson\'s quirky personality and hard-nosed approach often rubs her colleagues the wrong way, but her reputation as one of the world\'s best interrogator eventually wins over even her toughest critics.',119,46,'Crime',2005,7.6,'https://image.tmdb.org/t/p/w500/i1fhU9k84Da9tnlUE2LGO3tSNtW.jpg'),(4203,1414,'The Shield','The story of an inner-city Los Angeles police precinct where some of the cops aren\'t above breaking the rules or working against their associates to both keep the streets safe and their self-interests intact.',122,45,'Crime',2002,8.1,'https://image.tmdb.org/t/p/w500/AfdZXqqlFsPUEfi6kWWWthxw7Nz.jpg'),(4306,44187,'Burke\'s Law','Burke\'s Law, a revival of the 1960s cop television series of the same name, aired on CBS from 1994 to 1995. The series centers on Amos Burke, a senior Los Angeles police officer and millionaire, and his son, Peter, who is a detective under his command.',126,60,'Drama',1995,6,NULL),(4333,18777,'Paris','Paris is an American television series that appeared on the CBS television network from September 29, 1979 to January 15, 1980. A crime drama, the show is notable as the first-ever appearance of renowned actor James Earl Jones in a lead role on television and was created by Steven Bochco, who later achieved fame for Hill Street Blues and NYPD Blue, also served as executive producer.\n\nThe program told the story of Los Angeles Police Captain Woody Paris, who supervised a team of young detectives. The rookie investigators were led by Sergeant Stacy Erickson and included officers Charlie Bogart, Ernesto Villas, and Willie Miller. Hank Garrett portrayed Deputy Chief Jerome Bench, Paris\' superior, and, in an unusual turn for police dramas of that era, Paris\' home and off-duty life was given considerable attention in the plots, with Lee Chamberlin playing his wife, Barbara. Paris was also shown moonlighting as a professor of criminology at a local university.\n\nAlthough Paris was critically acclaimed for its portrayal of the tension between the professional Paris character and his often impetuous underlings, CBS scheduled the show in one of the worst possible timeslots on a weekly schedule: Saturdays at 10 p.m./9 Central. All three networks debuted new shows for the 1979-80 season in that slot; only ABC\'s Hart to Hart survived its first 13 weeks. Toward the end of its run, CBS moved it to Tuesdays at 10/9, but to no avail. Edward DeBlasio produced the show for MTM Enterprises, which would unveil, during the next season, executive producer Bochco\'s landmark Hill Street Blues, on NBC.',130,60,'Drama',1979,0,NULL);
